import React , {useState} from "react";
import LargeComponent from "../ItemsCollection/LargeComponent";
const Result =(props)=>{
    if (props.year === '2019') {
        return (
            <div>
                <LargeComponent items= {props.items[3]}/>
            </div>
        );
    }
    else if (year === '2020') {
        return (
            <div>
                <LargeComponent items= {props.items[2]}/>
            </div>
        );
    }
    else if (year === '2021') {
        return (
            <div>
                <LargeComponent items= {props.items[1]}/>
            </div>
        );
    }
    else if (year === '2022') {
        return (
            <div>
                <LargeComponent items= {props.items[0]}/>
            </div>
        );
    }
    return (
            <div>
                <LargeComponent items= {props.items[3]}/>
            </div>
        );
};
export default Result;
